import React, { useState} from 'react';

function Twe({detail,datas, data, setdatas}){
	const deletee = () =>{
		setdatas(datas.filter((t)=> t !== data));
	};
	
	return(
	<div>
<h1>{detail[0]}</h1>
	<h2>{data}</h2>
	<button onClick={deletee}>delete</button>
	</div>
)	



}
export default Twe;
